import React from 'react';
import { FaEnvelope, FaAddressBook, FaLinkedin, FaGithub } from 'react-icons/fa';

const Footer = () => {
  return (
    <div className="mt-5 pt-5 pb-5 footer" style={{ backgroundColor: '#343a40' }}>
      <div className="container">
        <div className="row">
          <div className="col-lg-3 col-xs-12 links">
            <h4 className="mt-lg-0 mt-sm-3">Links</h4>
            <ul className="m-0 p-0">
              <li><a href="mailto:amitkumar823906@gmail.com" style={{ color: '#fff', textDecoration: 'none' }}><FaEnvelope /> Email</a></li>
              <li><a href="https://www.crio.do/learn/portfolio/amitkumar823906/" style={{ color: '#fff', textDecoration: 'none' }}><FaAddressBook /> Portfolio</a></li>
              <li><a href="https://www.linkedin.com/in/amit-kumar-522180201/" style={{ color: '#fff', textDecoration: 'none' }}><FaLinkedin /> LinkedIn</a></li>
              <li><a href="https://github.com/Amitbabu123" style={{ color: '#fff', textDecoration: 'none' }}><FaGithub /> GitHub</a></li>
            </ul>
          </div>
          <div className="col-lg-4 col-xs-12 location">
            <h4 className="mt-lg-0 mt-sm-4">Location</h4>
            <p>New Delhi</p>
            <p className="mb-0"><i className="fa fa-phone mr-3"></i>(+91) 8239060323</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Footer;
